import React, { useState, useCallback } from 'react';
import s from './StepTel.module.css';
import { NavLink } from 'react-router-dom';
import {Field,Form} from 'react-final-form';
import setFormData from '../services/setFormData';
import getFormData from '../services/getFormData';
const StepTel = () => {
    const [initialValues] = useState(getFormData());

    const onSubmit = useCallback(
        (value)=>{
            setFormData(value);
        }
    );
    return (
        <div>
            <span>Оставьте заявку, и мы с вами свяжемся</span><br/>
            <span>Укажите свой номер телефона</span>
            <Form
            onSubmit = {onSubmit}
            initialValues = {initialValues}
            render = {({handleSubmit, form, submitting, pristine, values})=>(
                <form onChange={handleSubmit}>
                    <Field
                    className = {s.field}
                    name='UserTelNumber'
                    component='input'
                    type='number'
                    lable='User Tel Number'
                    variant='outlined'
                    />
                   {console.log(JSON.stringify(values, 0, 2))}
                     {/* <pre>{JSON.stringify(values, 0, 2)}</pre> */}
                     <NavLink to='/StepTel'><button type='submit'>Далее</button></NavLink>
                </form>
            )}
            />
{/*             

            <div>
                {Object.entries(initialValues).map(([label,value])=>{
                    return(
                        <p key={label}>
                            <b>{label}:</b>&nbsp;{value}
                        </p>
                    )
                })}
            </div> */}
        </div>
    );
};
export default StepTel;
